CREATE VIEW [${flyway:defaultSchema}].[vwEntities]
AS
SELECT
	e.*,
	${flyway:defaultSchema}.GetProgrammaticName(REPLACE(e.Name,' ','')) AS CodeName, /*For just the CodeName for the entity, we remove spaces before we convert to a programmatic name as many entity names have spaces automatically added to them and it is not needed to make those into _ characters*/
	${flyway:defaultSchema}.GetProgrammaticName(e.BaseTable + ISNULL(e.NameSuffix, '')) AS ClassName,
	${flyway:defaultSchema}.GetProgrammaticName(e.BaseTable + ISNULL(e.NameSuffix, '')) AS BaseTableCodeName,
	par.Name ParentEntity,
	par.BaseTable ParentBaseTable,
	par.BaseView ParentBaseView
FROM
	[${flyway:defaultSchema}].Entity e
LEFT OUTER JOIN
	[${flyway:defaultSchema}].Entity par
ON
	e.ParentID = par.ID
GO
