CREATE VIEW [${flyway:defaultSchema}].[vwCompanyIntegrations]
AS
SELECT
  ci.*,
  c.Name Company,
  i.Name Integration,
  i.ClassName DriverClassName,
  i.ImportPath DriverImportPath,
  cir.ID LastRunID,
  cir.StartedAt LastRunStartedAt,
  cir.EndedAt LastRunEndedAt
FROM
  ${flyway:defaultSchema}.CompanyIntegration ci
INNER JOIN
  ${flyway:defaultSchema}.Company c ON ci.CompanyID = c.ID
INNER JOIN
  ${flyway:defaultSchema}.Integration i ON ci.IntegrationID = i.ID
LEFT OUTER JOIN
  ${flyway:defaultSchema}.CompanyIntegrationRun cir
ON
  ci.ID = cir.CompanyIntegrationID AND
  cir.ID = (SELECT TOP 1 cirInner.ID FROM ${flyway:defaultSchema}.CompanyIntegrationRun cirInner WHERE cirInner.CompanyIntegrationID = ci.ID ORDER BY StartedAt DESC)
GO
