INNER JOIN
    sys.indexes i ON t.object_id = i.object_id
INNER JOIN
    sys.index_columns ic ON i.object_id = ic.object_id AND i.index_id = ic.index_id
INNER JOIN
    sys.columns c ON ic.object_id = c.object_id AND c.column_id = ic.column_id
WHERE
